import { Transaction } from './Transaction';
import { GlobalContext } from '../context/GlobalState';

export const TransactionList = () => {
  const { transactions } = useContext(GlobalContext);

  return (
    <>
      <h3>History</h3>
        <ul className="list">
          {transactions.map(transaction => (<Transaction /> ))}  
        </ul>
    </>
  )
}
